import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h2>Welcome to the Kitchen Companion App</h2>
      <p>Manage your recipes and ingredients with ease.</p>
      <Link to="/recipes">
        <button>Go to Recipe Management</button>
      </Link>
    </div>
  );
}

export default Home;
